import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      mosters: [
        { name: "Frankestein" },
        { name: "Dracula" },
        { name: "Zombie" },
      ],
    };
  }

  render() {
    return (
      <div className="App">

      {

       this.state.mosters.map(mosters => (  <h1>{mosters.name}</h1>  ))


      }


      </div>
    );
  }
}

export default App;
